import React from "react";
import "../style/like.css";
import { useContext } from "react";
import { CustomContext } from "../../utils/Context";
import Header from "../../MainLanding/pages/Header";
import Footer from "../../MainLanding/pages/Footer";

function Like() {
  const { favored, setFavored } = useContext(CustomContext);

  return (
    <>
      <Header />
      <div className="favored">
        <ul className="asd">
          {favored.map((item) => (
            <div className="ad" key={item.id}>
              <span>{item.name}</span>
            </div>
          ))}
        </ul>
      </div>
      {/* <Footer /> */}
    </>
  );
}

export default Like;
